function UserList({ users }) {
  if (!users.length) return null;

  const renderedUserss = users.map(({ name, email }, i) => {
    return (
      <tr key={`table-row-${i}`}>
        <td>{name}</td>
        <td>{email}</td>
      </tr>
    );
  });
  return (
    <table>
      <thead>
        <td>Name</td>
        <td>Email</td>
      </thead>
      <tbody>{renderedUserss}</tbody>
    </table>
  );
}

export default UserList;
